import React from 'react'

function Todo({task, todoNumber, setTaskList, taskList}) {
    const deleteHandler = (e) => {
        const newList = taskList.filter(delItem => delItem.id !== task.id)
        console.log(newList)
        setTaskList(newList)
    }
    const completeHandler = () => {
        setTaskList({
            ...taskList[{completed: true}]
        })
    }
    return (
        <div className='todo'>
            <li className='todo-item'>{todoNumber+1}. {task.text}</li>
            <button className='complete-btn'>
                <i className='fas fa-check'></i>
            </button>
            <button className='trash-btn' onClick={deleteHandler}>
                <i className='fas fa-trash'></i>
            </button>
        </div>
    )
}

export default Todo
